INSERT INTO `sys_log` VALUES ('1446264564106system153', 'system', 'queryForList', '实体属性', 'sys_attr', '/code/goList', 'SELECT t.COLUMN_NAME AS name, 		(CASE WHEN t.IS_NULLABLE = \'YES\' THEN \'1\' ELSE \'0\' END) AS isNull,		(t.ORDINAL_POSITION * 10) AS sort,		t.COLUMN_COMMENT AS comments,		t.CHARACTER_MAXIMUM_LENGTH as maxLength, 		t.COLUMN_TYPE AS jdbcType 	FROM information_schema.`COLUMNS` t 	WHERE t.TABLE_SCHEMA = (select database()) 		AND upper(t.TABLE_NAME) = upper(?) 	ORDER BY t.ORDINAL_POSITION', '[\"app_session\"]', '[{\"name\":\"ID\",\"isNull\":\"0\",\"sort\":10,\"comments\":\"id\",\"jdbcType\":\"int(11)\"},{\"name\":\"SESSION_ID\",\"isNull\":\"0\",\"sort\":20,\"comments\":\"sessionId\",\"maxLength\":64,\"jdbcType\":\"varchar(64)\"},{\"name\":\"USER_ID\",\"isNull\":\"1\",\"sort\":30,\"comments\":\"用户表id\",\"jdbcType\":\"int(11)\"},{\"name\":\"CREATE_TIME\",\"isNull\":\"1\",\"sort\":40,\"comments\":\"创建时间\",\"jdbcType\":\"bigint(13)\"},{\"name\":\"DEAD_TIME\",\"isNull\":\"1\",\"sort\":50,\"comments\":\"失效时间\",\"jdbcType\":\"bigint(13)\"},{\"name\":\"STATUS\",\"isNull\":\"1\",\"sort\":60,\"comments\":\"状态\",\"jdbcType\":\"tinyint(2)\"}]', '127.0.0.1', '1446264558539', 'admin', '2', '5', '7', '1');
